MATCH (p:Payer {name: 'Aetna'})-[:HAS_COVERED]->(e:Encounter)-[:HAS_PRESCRIBED]->(i:Immunization) 
WHERE NOT i.payerCoverage > 0 
RETURN COUNT(DISTINCT i.id);

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.code = '442571000124108'
RETURN DISTINCT p.firstName,p.lastName;

MATCH (p:Payer {name: 'Anthem'})-[:HAS_COVERED]->(en:Encounter)-[:HAS_DIAGNOSED]->(i:Immunization)
WHERE NOT i.code IN [(p)-[:HAS_COVERED]->(en)-[:HAS_DIAGNOSED]->(i2:Immunization)].code
RETURN COUNT(DISTINCT i.code);

MATCH (:Payer {name: 'Dual Eligible'})-[:HAS_COVERED]->(e:Encounter)-[:IS_ORDERED_DURING]->(p:Procedure)
WHERE NOT (e)-[:IS_COVERED_BY]->(:Payer {name: 'Dual Eligible'})
RETURN COUNT(DISTINCT p);

MATCH (e:Encounter)-[:HAS_DIAGNOSED]->(c:Condition)-[:IS_ABOUT]->(p:Patient), (cl:Claim {id: '44418f73-fa2d-adf0-52ed-c9b589e1f166'})
            WHERE e.encounterId = cl.encounterId
            RETURN c.description;

MATCH (e:Encounter {id: 'enc123'})-[:IS_COVERED_BY]->(p:Payer {name: 'Humana'}) 
WHERE NOT EXISTS (e)-[:HAS_COVERED]->()
RETURN COUNT(e) AS uncovered_encounters;

MATCH (p:Patient)-[:HAS_CLAIM]->(c:Claim)
WHERE c.id = '3608e404-6dcf-65bc-9944-2fabb7631db0'
RETURN DISTINCT p.firstName,p.lastName;

MATCH (p:Payer {id: 'b046940f-1664-3047-bca7-dfa76be352a4'})-[:HAS_COVERED]->(m:Medication) 
            WHERE m.payerCoverage = 0 
            RETURN COUNT(DISTINCT m);
